// import logo from './logo.svg';
import './App.css';
import { Router, Route, Switch } from "react-router";
import LandingPage from './views/landingPage'
function App() {
  return (
    <Router>
      <>
        <Switch>
          <Route exact path="/" component={LandingPage} />
          <Route exact path="/contact" component={contact} />
        </Switch>
      </>
    </Router>

  );
}

export default App;
